INSERT INTO Pregunta_Teorico (id_pregunta, pregunta_texto, Respuesta, Res1, Res2, Res3, Res4) VALUES (7, '¿CUAL ES EL MONTO DE LA MULTA POR ESTACIONAR EL VEHÍCULO EN UN LUGAR NO PERMITIDO SIMULANDO FALLA MECÁNICA?', 2, 'Q 50', 'Q 400', 'Q 200', 'Q 100');
