INSERT INTO Pregunta_Teorico (id_pregunta, pregunta_texto, Respuesta, Res1, Res2, Res3, Res4) VALUES (15, '¿EL ARCEN ES UNA FRANJA PARALELA A LA CALZADA Y PUEDEN USARLA?', 2, 'Para rebasar', 'Los vehículos con alguna emergencia', 'Estacionarse', 'Todas son correctas');
INSERT INTO Pregunta_Teorico (id_pregunta, pregunta_texto, Respuesta, Res1, Res2, Res3, Res4) VALUES (16, '¿POR REGLA GENERAL ESTA PROHIBIDO?', 1, 'Bocinarle al automóvil de en frente para apurarlo', 'Rebasar por el carril izquierdo', 'Detenerse cuando exista la señal de alto', 'Ninguna es correcta');
INSERT INTO Pregunta_Teorico (id_pregunta, pregunta_texto, Respuesta, Res1, Res2, Res3, Res4) VALUES (17, '¿UD. VA MANEJANDO Y EL COPILOTO TIRA BASURA POR LA VENTANA?', 1, 'Multan al piloto por ser el conductor', 'Es permitido hacerlo y no multan a nadie', 'Multan a quien tiro la basura', 'Ninguna es correcta');
INSERT INTO Pregunta_Teorico (id_pregunta, pregunta_texto, Respuesta, Res1, Res2, Res3, Res4) VALUES (18, '¿CARRIL QUE SIRVE PARA REALIZAR UN DESVIO EN UNA CALZADA?', 1, 'Carril auxiliar', 'Carril de aceleración', 'Carril de desaceleracion', 'Ninguna es correcta');
INSERT INTO Pregunta_Teorico (id_pregunta, pregunta_texto, Respuesta, Res1, Res2, Res3, Res4) VALUES (19, '¿QUE NOS INDICA EL SEMÁFORO EN ROJO?', 4, 'Continuar la marcha', 'Aproximación a cruce', 'Ceder el paso', 'Detenerse obligatoriamente');
INSERT INTO Pregunta_Teorico (id_pregunta, pregunta_texto, Respuesta, Res1, Res2, Res3, Res4) VALUES (20, '¿DE QUE COLOR ESTÁN PINTADAS LAS SEÑALES PREVENTIVAS?', 2, 'Amarillo y azul', 'Amarillo y negro', 'Amarillo y rojo', 'Amarillo y blanco');
INSERT INTO Pregunta_Teorico (id_pregunta, pregunta_texto, Respuesta, Res1, Res2, Res3, Res4) VALUES (21, '¿QUE FUNCIÓN CUMPLE LA LINEA DOBLE AMARILLA PINTADA EN LA CARRETERA?', 3, 'Divide carriles en un solo sentido', 'Permite rebasar o adelantar', 'Divide grupos de carriles que van en diferentes sentido de circulacion', 'Ninguna es correcta');
INSERT INTO Pregunta_Teorico (id_pregunta, pregunta_texto, Respuesta, Res1, Res2, Res3, Res4) VALUES (22, '¿DE QUE COLORES ESTÁN PINTADAS LAS SEÑALES CIRCUNSTANCIALES (TEMPORALES)?', 3, 'Azul, verde y blanco', 'Blanco,rojo y negro', 'Naranja', 'Ninguna es correcta');
INSERT INTO Pregunta_Teorico (id_pregunta, pregunta_texto, Respuesta, Res1, Res2, Res3, Res4) VALUES (23, '¿EN QUE CASO SE APLICAN MULTAS DE Q1,000?', 1, 'Por faltarle el respeto a la autoridad', 'Por pasar un semáforo en rojo', 'Por atropellar un peatón', 'Todas son correctas');
INSERT INTO Pregunta_Teorico (id_pregunta, pregunta_texto, Respuesta, Res1, Res2, Res3, Res4) VALUES (24, '¿QUE ES LA LICENCIA DE CONDUCIR?', 1, 'Documento que identifica al conductor', 'Documento de identifica al pasajero', 'Documento que identifica al vehículo', 'Ninguna es correcta');
